import Questions from '../Questions/Questions'

function Home(props) {
    const [questions, setQuestions] = useState([])
    useEffect(() => {
        // GET request using fetch inside useEffect React hook
        fetch('/api/questions')
            .then(response => {
                setQuestions(response)
